	<script type="text/javascript">
		var xdmClients = {
			data: Beat.xdm.register('data', processData),
			cookies: Beat.xdm.register('cookies', processCookies),
			request: Beat.xdm.register('request', processRequest)
		};
		
		function processData(data) {
			var res = Beat.data[data.method].apply(null, data.args);
			if (data.callback)
				xdmClients.data.send({ data: res, callback: data.callback });
		};

		function processCookies(data) {
			var res = Beat.Cookies[data.method].apply(null, data.args);
			if (data.callback)
				xdmClients.cookies.send({ data: res, callback: data.callback });
		};

		function processRequest(data) {
			var res = Beat.jxGet(data.url, function (res) {
				xdmClients.request.send({ data: res, callback: data.callback });
			});
		};
	</script>
